void mainImage( out vec4 fragColor, in vec2 fragCoord )
{
    // Normalized pixel coordinates (from 0 to 1)
    vec2 uv = fragCoord/iResolution.xy;


    float xVal = tan(iTime * uv.x);//sin(iTime) * uv.x;
    float yVal = tan(iTime * uv.y);//cos(iTime) * uv.y;
    float zVal = tan(iTime);

    // Output to screen
    fragColor = vec4(xVal,yVal,zVal,1.0);
}
